import React, { Component } from "react";
import { getEmployees, getWorklog } from "./api";
import EmployeesList from "./components/EmployeesList";
import {BrowserRouter, Route, Switch} from "react-router-dom";

class App extends Component {
  state = {
    loading: true,
    employees: [
      {
        id: 1,
        firstName: "Леонид",
        lastName: "Старокадомский",
        middleName: "Михайлович",
        birthDate: "1875-03-27",
        phone: "+79975669545"
      },
      {
        id: 2,
        firstName: "Владимир",
        lastName: "Демихов",
        middleName: "Петрович",
        birthDate: "1916-06-18",
        phone: "+74951263366"
      },
      {
        id: 3,
        firstName: "Виктор",
        lastName: "Калнберз",
        middleName: "Константинович",
        birthDate: "1928-06-02",
        phone: "+37156698963"
      },
      {
        id: 4,
        firstName: "Алоис",
        lastName: "Альцгеймер",
        middleName: "Эдуардович",
        birthDate: "1864-06-14",
        phone: "+15559665599"
      },
      {
        id: 5,
        firstName: "Авиценна",
        lastName: "Сина",
        middleName: "Абу Али Ибн",
        birthDate: "980-08-23",
        phone: "+15559171855"
      },
      {
        id: 6,
        firstName: "Александр",
        lastName: "Флеминг",
        middleName: "Хугович",
        birthDate: "1881-08-06",
        phone: "+4569988569"
      }
    ],
    worklog: []
  };

  render() {
    const { loading } = this.state;

    if (loading) {
      return "Loading...";
    }

    return (
        <BrowserRouter>
          <Switch>
            <Route exact path="/">
              <EmployeesList list={this.state.employees}/>
            </Route>
          </Switch>
        </BrowserRouter>



    );
  }

  componentDidMount() {
    this.setState({
      loading: false
    });
  }
}

export default App;
